INSERT INTO `ticket` VALUES ('T201901100074', '2019-01-10 14:42:38', '0000-00-00 00:00:00', '2019-01-14 09:30:10', 'U0006', 'ast_desktop', '11', 'DATA FILTER ENTITY', 'DEAR TEAM AST, MOHON BANTUANNYA ADA TEMUAN PADA DATA ENTITY MIE MASUK KE ENTITY HO. SEPERTI GAMBAR YANG DI KIRIM.\n\nTERIMA KASIH.', 'U0014', '6', '100', 'Y');
INSERT INTO `ticket` VALUES ('T201901110075', '2019-01-11 15:32:26', '2019-01-16 13:17:27', '0000-00-00 00:00:00', 'U0005', 'ast_desktop', '11', 'SALAH PERHITUNGAN INTEREST PENALTY OWNERSHIP', 'UNTUK DENDA OWNERSHIP, DENDA DIHITUNG FLAT, JGN MENGGULUNG.\nDAN PERHITUNGAN DENDA BERDASARKAN DPP.\nCONTOH MASALAH:\nUNIT NV2/022/O, NILAI INVOICE PER BULAN, 271040,\nDENDA BULAN NOV DAN DES ADALAH 49290, DAN MASING2 DENDA BERNILAI 24640\n\nNOTES: FILE A.PNG TERDAPAT INVOICE DENDA MANUAL, MERUPAKAN NILAI YANG DENDA YANG BENAR.', 'U0011', '4', '0', null);
